import React from 'react';
import PropTypes from 'prop-types';

const Project = () => {
  // Sample project data to prevent map error
  const projects = [
    {
      title: "AgroMaart - Online Agriculture Marketplace",
      icon: "ri-shopping-cart-fill",
      description: "Platform connecting farmers, buyers, and delivery personnel in a seamless marketplace.",
      date: "2023",
      additionalInfo: "Technologies: React, HTML, CSS, Spring Boot, Hibernate, MySQL",
      imageSrc: require('../../assets/images/AgroMart.webp'),
      animation: "fade-left",
    },
    {
      title: "Music Recommendation System",
      icon: "ri-music-fill",
      description: "A personalized music recommendation system leveraging user preferences and listening history.",
      date: "2023",
      additionalInfo: "Technologies: Python, Flask, TensorFlow, Spotify API",
      imageSrc: require('../../assets/images/Music.webp'),
      animation: "fade-right",
    },
    {
      title: "Drug Review Using NLP",
      icon: "ri-brain-fill",
      description: "An analysis tool to interpret and categorize drug reviews using natural language processing.",
      date: "2023",
      additionalInfo: "Technologies: Python, Flask, NLP, TensorFlow",
      imageSrc: require('../../assets/images/drug.webp'),
      animation: "fade-left",
    },
  ];

  return (
    <section id="project" style={styles.section}>
      <div style={styles.container}>
        {/* Projects Section Header */}
        <div style={styles.sectionHeader}>
          <h2 style={styles.sectionTitle}>Projects</h2>
        </div>

        {/* Projects Timeline */}
        <div style={styles.timelineContainer}>
          <div style={styles.timelineContent}>
            {projects.map((project, index) => (
              <TimelineCard
                key={index}
                {...project} // Destructured props for cleaner code
              />
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

// Timeline Card Component
const TimelineCard = ({ title, icon, description, date, additionalInfo, imageSrc, animation }) => (
  <div style={styles.cardContainer}>
    <div style={styles.iconContainer}>
      <img src={imageSrc} alt={`Icon for ${title}`} style={styles.iconImage} />
    </div>
    <div style={styles.cardContent}>
      <div data-aos={animation} data-aos-duration="1200" style={styles.timelineCard}>
        <h3 style={styles.cardTitle}>
          {icon && <i className={`${icon} mr-2`} aria-hidden="true"></i>} {title}
        </h3>
        <p style={styles.cardDescription}>{description}</p>
        {date && <p style={styles.cardDate}>{date}</p>}
        {additionalInfo && <p style={styles.cardAdditionalInfo}>{additionalInfo}</p>}
      </div>
    </div>
  </div>
);

// PropTypes for TimelineCard Component
TimelineCard.propTypes = {
  title: PropTypes.string.isRequired,
  icon: PropTypes.string,
  description: PropTypes.string.isRequired,
  date: PropTypes.string,
  additionalInfo: PropTypes.string,
  imageSrc: PropTypes.string.isRequired,
  animation: PropTypes.string.isRequired,
};

// CSS-in-JS Styles with improved readability
const styles = {
  section: {
    padding: '4rem 2rem',
    background: 'linear-gradient(135deg, #e0f7fa, #f1f8e9)',
    borderRadius: '0.75rem',
    boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)',
  },
  container: {
    maxWidth: '1200px',
    margin: '0 auto',
    padding: '0 1rem',
  },
  sectionHeader: {
    textAlign: 'center',
    marginBottom: '3rem',
  },
  sectionTitle: {
    color: '#00796b',
    fontWeight: 'bold',
    fontSize: '2.5rem',
    marginBottom: '0.5rem',
    textTransform: 'uppercase',
    letterSpacing: '1.5px',
  },
  timelineContainer: {
    display: 'flex',
    flexDirection: 'column',
    gap: '2rem',
    padding: '2rem',
    backgroundColor: '#ffffff',
    borderRadius: '0.75rem',
    boxShadow: '0 4px 16px rgba(0, 0, 0, 0.05)',
  },
  timelineContent: {
    display: 'flex',
    flexDirection: 'column',
    gap: '2rem',
  },
  cardContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '1.5rem',
    backgroundColor: '#e1f5fe',
    padding: '1.5rem',
    borderRadius: '0.75rem',
    transition: 'transform 0.3s ease',
    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
  },
  cardContent: {
    flex: 1,
  },
  timelineCard: {
    padding: '1.25rem',
    borderRadius: '0.75rem',
    backgroundColor: '#b2ebf2',
  },
  iconContainer: {
    flexShrink: 0,
  },
  iconImage: {
    width: '70px',
    height: '70px',
    objectFit: 'cover',
    borderRadius: '50%',
  },
  cardTitle: {
    fontWeight: 'bold',
    fontSize: '1.6rem',
    color: '#00796b',
  },
  cardDescription: {
    fontSize: '1rem',
    color: '#37474f',
    marginTop: '0.5rem',
  },
  cardDate: {
    fontStyle: 'italic',
    color: '#5d4037',
    marginTop: '0.25rem',
  },
  cardAdditionalInfo: {
    fontSize: '0.9rem',
    color: '#4e342e',
    marginTop: '0.25rem',
  },
};

export default Project;
